export const InfoIcon = ({
  tooltip,
  style,
  tooltipNode,
  id,
}: {
  id: string;
  tooltip?: string;
  style?: any;
  tooltipNode?: any;
}) => {
  const tooltipId = tooltip?.slice(0, 50)?.replaceAll(' ', '');
  return (
    <>
      <span
        data-tip={true}
        data-tooltip-id={id}
        className={'cursor-pointer info-icon'}
      >
        <InfoSvg />
      </span>
      {(tooltip || tooltipNode) && (
        <CustomTooltip id={id}>
          {tooltipNode ? tooltipNode : <div style={style}>{tooltip}</div>}
        </CustomTooltip>
      )}
    </>
  );
};

